      // Event callback.
      var editor = this;
      var contentLoc = $(editor.el).parents(".editable").data("location");
      var contentType = $(editor.el).parents(".editable").data("type");
      var contentID = $(editor.el).parents(".editable").data("id");

      editor.opts.saveParam = contentLoc;
      editor.opts.saveURL = domain + "/api/pages/content?id=" + contentID + "&type=" + contentType + "&site_id=" + site_id;

      // Mouse down on link.
      editor.events.$on(editor.$el, editor._mousedown, ".social-link", function () {
        var range = editor.doc.createRange();
        range.selectNodeContents(this);

        if ($(this).text().length == 0 || !$(this).prev().hasClass("social-link")) {
          $(this).prepend(FroalaEditor.INVISIBLE_SPACE);
        }

        var sel = editor.win.getSelection();
        sel.removeAllRanges();
        sel.addRange(range);
      });

      // Mouseup on link.
      editor.events.$on(editor.$el, editor._mouseup, ".social-link, .delete-contact-form, .delete-row", function (e) {
        e.preventDefault();
      });

