$(".content-save").on("click", function (e) {
  e.preventDefault();

  $(this).addClass("loading").text("Saving...");

  $(editor).each(function () {
    if ($(this).data("changed")) {
      this.save.save();
    }
  });
});

$(window).bind("beforeunload", function (e) {
  if (!cleanBuild) {
    e.preventDefault();
    return "Are you sure?";
  }
});

if (window.devHelper && document.querySelector(".site-data")) {
  // show dev helper button if activated
  document.querySelector(".site-data").classList.add("is-active");
  document.getElementById("tot_content-save").classList.add("has-helper");

  // calculate missing alt tags
  var imgs = document.querySelectorAll("img");
  var imgErrorCount = 0;
  Array.from(imgs).forEach(function (img) {
    if (!img.getAttribute("alt") && !img.classList.contains("is-alternate")) {
      imgErrorCount++;
      var src = img.getAttribute("src");
      document.querySelector(".calc--alt-srcs").insertAdjacentHTML("beforeend", "<span>" + src.substring(src.lastIndexOf("/") + 1) + "</span>");
    }
  });
  document.querySelector(".calc--alt").innerText = imgErrorCount;

  // calculate headline
  var headline = document.querySelector("h1");
  document.querySelector(".calc--headline").innerText = headline ? headline.innerText : "not set";

  // attach click handler to show/hide dev helper drawer
  var toggler = document.querySelector(".site-data--toggle");
  toggler.addEventListener("click", function (e) {
    e.preventDefault();
    toggler.classList.toggle("is-open");
    document.querySelector(".site-data--content").classList.toggle("is-showing");
  });
}

window.parent.postMessage(window.location.href, "*");

